import { useContext, useEffect, useState } from "react";
import {Link, useNavigate} from 'react-router-dom';
import { UserContext, getAccessToken } from "../UserContext";
import './home-page.css'
import SearchBar from "../SearchBar/SearchBar";
import FavoritesPage from "../favorites/FavoritesPage";

export default function HomePage(){

    //fetch aici ca sa imi faca lista cu categoriile. o sa ma folosesc de functia aia map

    return(
        <main>
            <header className="header" >
                <h1 id="title">
                    <Link to='/' id="link-title">My Recipe</Link>
                </h1>
                <SearchBar/>
                <FavoritesPage>
                    <a href="../favorites">My FAvorites Page</a>
                </FavoritesPage>
            </header>

            <div className="recipe_category">
                <h3>Recipe Categories</h3>
                <ul className="category_list">
                    <li className="category_item"></li>
                </ul>
            </div>
        </main>
    );
}
